import React, { useState } from 'react';

const App = () => {
    const [key, setKey] = useState('');
    const [value, setValue] = useState('');
    const [hashType, setHashType] = useState('extendible');
    const [result, setResult] = useState(null);

    const handleInsert = async () => {
        const response = await fetch(`/${hashType}/insert`, {
            method: 'POST',
            headers: { 'Content-Type': 'application/json' },
            body: JSON.stringify({ key: parseInt(key), value })
        });
        const data = await response.json();
        setResult(data);
    };

    const handleSearch = async () => {
        const response = await fetch(`/${hashType}/search?key=${key}`);
        const data = await response.json();
        setResult(data);
    };

    const handleDelete = async () => {
        const response = await fetch(`/${hashType}/delete`, {
            method: 'DELETE',
            headers: { 'Content-Type': 'application/json' },
            body: JSON.stringify({ key: parseInt(key) })
        });
        const data = await response.json();
        setResult(data);
    };

    return (
        <div>
            <h1>Hashing Example</h1>
            <select onChange={(e) => setHashType(e.target.value)} value={hashType}>
                <option value="extendible">Extendible Hashing</option>
                <option value="linear">Linear Hashing</option>
            </select>
            <input
                type="number"
                placeholder="Key"
                value={key}
                onChange={(e) => setKey(e.target.value)}
            />
            <input
                type="text"
                placeholder="Value"
                value={value}
                onChange={(e) => setValue(e.target.value)}
            />
            <button onClick={handleInsert}>Insert</button>
            <button onClick={handleSearch}>Search</button>
            <button onClick={handleDelete}>Delete</button>
            {result && <pre>{JSON.stringify(result, null, 2)}</pre>}
        </div>
    );
};

export default App;
